import React from 'react';
import { Jumbotron, Container } from 'reactstrap';
import Pulisic from '../assets/images/cp2.jpg';
import './styles/contentStyle.css';

const Example = (props) => {
  return (
    <div>
      <Jumbotron fluid>
        <Container fluid>
          <h1 className="display-3">GOAL LEADERS</h1>
          <img src={Pulisic} className='puli' />
        </Container>
      </Jumbotron>
    </div>
  );
};

export default Example;
